document.addEventListener("DOMContentLoaded",function(){if(HawkeyeOverlayTool.instance.config.enabled){let e=Array.from(document.querySelectorAll("script")).find(e=>e.src.match(/.*\/plugins\//)).src,n=e.replace(window.location.origin,"").match(/.*\/plugins\//);document.body.addEventListener("click",function(e){if(e.target&&"call-markup"===e.target.id){var t=document.getElementById("url-val").value;"/"==t.substr(0,1)?window.open(n[0]+"natasha/natasha.html?url="+window.location.protocol+"//"+window.location.host+t):window.open(n[0]+"natasha/natasha.html?url="+t)}})}});var fileCall=function(e){console.log(e);const n=document.querySelector("#overlayImageInput"),t=new DataTransfer;t.items.add(e),n.files=t.files,n.dispatchEvent(new Event("change"))};